import React from 'react';

const CompanyList = ({ companies }) => {

  return (
    <div className='company-div'>
      {companies.map( com => (
        <div key={com.handle}> 
          <p>{com.handle}</p> 
        </div>  
      ))}  
    </div>  
  );
};

export default CompanyList;
